head.script:
function quick_payment() {
         var orderNo = $("#txtQuickOrderNo").val().trim();
         var amount = $("#txtQuickAmount").val().trim();
         if (orderNo == "" || orderNo == "Order number") {
             $("#txtQuickOrderNo").focus();
             return false;
         }
         window.location = quick_payment_url + "?id=" + orderNo + "&amount=" + amount;
     }
     function confirmLogout() {
         return window.confirm("Log Out?");
     }

div.script:
 $(function () {
    $("#seltype1").change(function () {
        var val = $("#seltype1").val();
        var childs = categories["p" + val];
        var sel = $("#seltype2");
        sel.empty();
        for (var i = 0; i < childs.length; i++) {
            var child = childs[i];
            sel.append("<option value=\"" + child.i + "\">" + child.n + "</option>");
        }
    });
});

function checkQtyForm() {
      var count = 0;
      $(".qtyInput").each(function () {
          count += parseInt($(this).val());
      });
      if (count == 0) {
          alert("Please select products..");
          return false;
      }
      return true;
  }
  $(function () {
      $(".reduce_qty").each(function () {
          $(this).click(function () {
              var qty = $(this).next();
              var qtyVal = parseInt(qty.val());
              var val = isNaN(qtyVal) ? 0 : qtyVal - 1;
              qty.val(val < 0 ? 0 : val);
          })
      });
      $(".add_qty").each(function () {
          $(this).click(function () {
              var qty = $(this).prev();
              var qtyVal = parseInt(qty.val());
              var val = isNaN(qtyVal) ? 1 : qtyVal + 1;
              qty.val(val);
          })
      });
      $(".qtyInput").each(function () {
          $(this).change(function () {
              var val = $(this).val();
              if (isNaN(val)) {
                  $(this).val(0);
              }
          });
      });

  });

